const malbec = {
  grape: 'Malbec',
  style: 'Red',
  dominantFlavors: ['Plum', 'Blueberry', 'Vanilla', 'Tabacco', 'Cocoa'],
  possibleFlavors: [
    { Fruit: ['Cherry', 'Black Raspberry','Raisin', 'Prune'] },
    { Flower: ['Wild Iris'] },
    { Herbs: ['Sage', 'Yerba Mate'] },
    { earthAndOthers: ['Clay Pot'] },
    { Oak: ['Cinnamon', 'Baking Spices', 'Milk Chocolate'] },
    { Herbs: ['Wild Iris', 'Sage', 'Yerba Mate'] }
  ],
  countries: ['Argentina', 'France', 'Chile', 'USA', 'South Africa', 'Australia', 'Italy'],
  drinkingTemperature: 'Room Temperature'
}

const WineDB = [malbec];

export default WineDB;
